INSERT INTO `bx_dashiji` VALUES ('21', '', '2011', null, 'http://182.50.112.199:82/upload/userfiles/1/images/dsjphoto/2016/05/bx_dasj2011.png', '<p class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\', serif;\">BNBM House undertook construction of the new style housing project of the largest single building area in the world &mdash; Zambia </span></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\', serif;\">Community Project which includes about 4,500 houses;</span></span><span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\', serif;\">BNBM House started construction of its Chengdu Base in Sichuan Province;</span></span><span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\', serif;\">BNBM House participated in post-disaster reconstruction after &ldquo;3.11&rdquo; Earthquake in Japan.</span></span><span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p>');
INSERT INTO `bx_dashiji` VALUES ('22', '', '2012', null, 'http://182.50.112.199:82/upload/userfiles/1/images/dsjphoto/2016/05/bx_dasj2012.png', '<p class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\', serif;\">BNBM House started the first BNBM green town in Beijing &mdash; Shichengzhen Green Town Project in Miyun, Beijing.</span></span><span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\', serif;\">In 2012, BNBM House started construction of its Lianyungang Base in Jiangsu Province;</span></span><span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:14px;\"><span lang=\"EN-US\" style=\"font-family: \'Times New Roman\', serif;\">BNBM House started construction of its Ding&rsquo;an Base in Hainan Province;</span></span><span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\"><o:p></o:p></span></p>');
INSERT INTO `bx_dashiji` VALUES ('28', '', '2015', null, 'http://182.50.112.199:82/upload/userfiles/1/images/dsjphoto/2016/05/bx_dasj2015.png', '<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;mso-bidi-font-size:\r\n11.0pt;font-family:&quot;Times New Roman&quot;,serif\">BNBM House completed construction of the steel structure building barracks demonstration project in Tibet Shigatse Military Region </span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;mso-bidi-font-size:\r\n11.0pt;font-family:&quot;Times New Roman&quot;,serif\">which was the first of its nature constructed in severely cold and high-altitude area.;<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;mso-bidi-font-size:\r\n11.0pt;font-family:&quot;Times New Roman&quot;,serif\">BNBM House undertook construction of Jiayi &bull; Ridge Bay Project in Dali, Yunnan Province, which marked its successful exploration </span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;mso-bidi-font-size:\r\n11.0pt;font-family:&quot;Times New Roman&quot;,serif\">into tourism and vocation resort market again.<o:p></o:p></span></p>');
INSERT INTO `bx_dashiji` VALUES ('27', '', '2014', null, 'http://182.50.112.199:82/upload/userfiles/1/images/dsjphoto/2016/05/bx_dasj2014.png', '<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">BNBM House completed the &ldquo;EU Strategy Standard 2020&rdquo; Residential Houses Project in Denmark, marking its successful entry into the </span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">European and American high-end market.<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">In 2014, BNBM House undertook construction of Chengdu Elderly Caring and Health Caring Community Project in Sichuan Province, </span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">which marks its marching into the high-end elderly caring market;<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">BNBM House officially launched the One-Thousand New Type Houses Project in Papua New Guinea, which is another major overseas </span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">project of BNBM House;<o:p></o:p></span></p>');
INSERT INTO `bx_dashiji` VALUES ('26', '', '2013', null, 'http://182.50.112.199:82/upload/userfiles/1/images/dsjphoto/2016/05/bx_dasj2013.png', '<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">BNBM House participated in the Solar Decathlon and successfully developed the &ldquo;O-House&rdquo; of zero energyconsumption</span><span style=\"font-size:9.0pt;\r\nfont-family:;mso-ascii-font-family:&quot;Times New Roman&quot;;mso-fareast-font-family:\r\n;mso-fareast-theme-font:minor-fareast;mso-hansi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;\"></span><span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">and achieved </span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">the&ldquo;Most comfortable&rdquo; Award;<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">BNBM House started construction of its Mudanjiang Base in Heilongjiang Province;<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">BNBM House cooperated with Jackie Chan Foundation to undertake aid construction of Ya&rsquo;an Tianquan Seniors&rsquo; Home Project after </span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">Ya&rsquo; an Earthquake in Sichuan Province;<o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">BNBM House started construction of the first Chinese style new housing demonstration project in the world &mdash; Guang&rsquo;an Green Town </span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:9.0pt;font-family:&quot;Times New Roman&quot;,serif\">in Sichan Province.<o:p></o:p></span></p>\r\n<p>\r\n	&nbsp;</p>');
