 health-caring buildings, etc.</span></strong></p>\r\n		</div>\r\n	</div>\r\n</div>\r\n<p>\r\n	<img alt=\"\" src=\"http://182.50.112.199:82/upload/userfiles/1/images/cms/article/2016/06/000000000000000000.png\" style=\"width: 500px; height: 309px; margin-left: 50px; margin-right: 50px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<div class=\"wx96Diy\" data-source=\"bj.96weixin.com\">\r\n	<div style=\"width:100%;height:auto;overflow:hidden;margin:0 auto;padding:0;display:block\">\r\n		<div class=\"96wx-bdbc 96wx-color\" style=\"margin:0 15px;width:auto;border-bottom:2px solid #1EB2E1;text-align:center;font-size:16px;font-weight:700;color:#1EB2E1;padding:5px 0 15px 0;margin-top:0\">\r\n			<span style=\"color:inherit\">Multi-story Building Products</span></div>\r\n		<div style=\"width:16%;height:2px;background:#fff;margin-top:-2px;top:48px;margin-left:42%\">\r\n			&nbsp;</div>\r\n		<div class=\"96wx-bgc\" style=\"width:9px;height:9px;background:#1EB2E1;top:38px;margin-top:-5px;margin-left:auto;margin-right:auto;transform:rotate(45deg);-webkit-transform:rotate(45deg);-moz-transform:rotate(45deg)\">\r\n			&nbsp;</div>\r\n		<div style=\"word-break: break-all; margin: 10px 15px; width: auto; padding: 0px 10px; height: auto; color: #000000; text-align: left; font-size: 14px;\">\r\n			<p style=\"text-align: justify;\">\r\n				<strong><span style=\"font-family: \'Times New Roman\', serif;\">The multi-storey building adopts steel frame as its main structure and light gauge steel framework as its envelop enclosure. This product combines the benefits of both systems, which not only provides wider space to make spatial arrangement more flexible, but also realizes fast installation, guarantees excellent damp-proofing, thermal and acoustic insulation performance and further enhance its earthquake and wind resistance performance.</span></strong></p>\r\n			<p style=\"text-align: justify;\">\r\n				<strong><span style=\"font-family: \'Times New Roman\', serif;\">The product is applicable to 6-storey or below small &amp; medium-sized buildings, such as residential houses</span></strong><strong><span style=\"font-family: \'Times New Roman\', serif;\">, apartments, hotels, clubs, natatoriums, office buildings, hospitals, schools and vacation resort facilities, etc.</span></strong></p>\r\n			<p style=\"text-align: justify;\">\r\n				&nbsp;</p>\r\n			<p style=\"text-align: justify;\">\r\n				<img alt=\"\" src=\"http://182.50.112.199:82/upload/userfiles/1/images/cms/article/2016/06/00000000000000000000000.png\" style=\"width: 458px; height: 486px; margin-left: 50px; margin-right: 50px;\" /></p>\r\n		</div>\r\n	</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
