INSERT INTO `cms_article_data` VALUES ('49fbebcf93b0458e988d27d749aaa83c', '<p class=\"MsoNormal\" style=\"text-indent: 14.2pt; line-height: 21pt; text-align: justify;\">\r\n	<span lang=\"EN-US\" style=\"font-size: 11pt; font-family: \'Times New Roman\', serif;\">BNBM House Co.,Ltd(BNBM House), with a total investment of 2 billion yuan, is a member company of China National Building Materials Group Corporation (CNBM) which is a global Fortune 500 company. BNBM House which is controlled by Beijing New Building Material (Group) Co., Ltd. is a platform for new type house business, one of the &ldquo;Three New&rdquo; strategies of CNBM.</span><span lang=\"EN-US\" style=\"font-family: Helvetica, sans-serif;\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 14.2pt; line-height: 21pt; text-align: justify;\">\r\n	<span lang=\"EN-US\" style=\"font-size: 11pt; font-family: \'Times New Roman\', serif;\">With its house business started in 1990s, the Company has been engaged in and committed to development, promotion and application of new housing industry for more than three decades. The Company owns a complete industrial chain of new type houses and has established bases in Beijing, Sichuan, Jiangsu, Heilongjiang, Hainan and other places and formed a national industrial layout. The Company has the world&#39;s advanced light-gauge steel structure housing technology of its own proprietary intellectual property rights and is a core participant in preparation of Technical Specification for low-rise cold-formed thin-walled steel building JGJ 227-2011 (industrial standard). At the end of 2002, BNBM House was authorized among the first batch of &ldquo;State Housing Industrialization Bases&rdquo; by the Ministry of Construction (the current Ministry of Housing and Urban-Rural Development).</span><span lang=\"EN-US\" style=\"font-family: Helvetica, sans-serif;\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"text-indent: 14.2pt; line-height: 21pt; text-align: justify;\">\r\n	<span lang=\"EN-US\" style=\"font-size: 11pt; font-family: \'Times New Roman\', serif;\">BNBM House Company has fully realized &ldquo;integration of materials and housing&rdquo; and &ldquo;integration of design, production and construction&rdquo;. Based on the world advanced technology absorbed and after several years of exploration and development, integrated innovation and continuous optimization, the Company has fully realized industrialized production of its housing systems. Plus its comprehensive supply chain management system, professional logistics and installation service system, it is committed to providing customers with green, energy-efficiency and low-carbon integrated solutions</span><span lang=\"EN-US\" style=\"font-family: Helvetica, sans-serif;\"><o:p></o:p></span></p>', '', '', '1');
