INSERT INTO `cms_article_data` VALUES ('af496a768e844baebe67b46285b9c47b', '<p class=\"MsoNormal\" style=\"margin-bottom: 6pt; margin-left: -21.2pt; text-indent: 14.2pt; line-height: 19.5pt; text-align: justify;\">\r\n	<span lang=\"EN-US\" style=\"font-size: 11pt; font-family: \'Times New Roman\', serif;\">China National Building Materials Group Corporation (CNBM) was established in 1984 with approval from the State Council, and then became a Central Enterprise under direct supervision of State-owned Assets Supervision and Administration Commission of the State Council in 2003.</span><span lang=\"EN-US\" style=\"font-family: Helvetica, sans-serif;\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 6pt; margin-left: -21.2pt; text-indent: 14.1pt; line-height: 19.5pt; text-align: justify;\">\r\n	<span lang=\"EN-US\" style=\"font-size: 11pt; font-family: \'Times New Roman\', serif;\">As the leader in China&rsquo;s building materials industry, CNBM is the largest comprehensive building materials industry group in China. It has been ranked first among the top 500 enterprises in the building materials industry for many years, 50th among the Top 500 Enterprise in China and 270th among the Fortune Global 500. Up to the end of 2014, the total assets of the Group amounted to RMB 406.9 billion and the total number of employees reached 176,854. In 2014, CNBM achieved revenue of RMB 250.4 billion with total profit of RMB 13.0 billion, whilst taxes paid amounted to RMB14.6 billion.</span><span lang=\"EN-US\" style=\"font-family: Helvetica, sans-serif;\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 6pt; margin-left: -21.2pt; text-indent: 14.1pt; line-height: 19.5pt; text-align: justify;\">\r\n	<span lang=\"EN-US\" style=\"font-size: 11pt; font-family: \'Times New Roman\', serif;\">With the objective to maximize corporate value and improve core competence, CNBM has developed into a comprehensive building materials industry group with integration of manufacturing, scientific research and development, set of equipment, logistics and trading, through asset restructuring, business integration and management improvement.</span><span lang=\"EN-US\" style=\"font-family: Helvetica, sans-serif;\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 6pt; margin-left: -21.2pt; text-indent: 14.1pt; line-height: 19.5pt; text-align: justify;\">\r\n	<span lang=\"EN-US\" style=\"font-size: 11pt; font-family: \'Times New Roman\', serif;\">Headquartered in Beijing, CNBM has over 1,100 member companies, dominates 6 listed companies, including 2 overseas listed companies. Member companies of CNBM are located in 30 Chinese provinces, municipalities and autonomous regions, whole businesses cover over 120 countries and regions in the world.</span><span lang=\"EN-US\" style=\"font-family: Helvetica, sans-serif;\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 6pt; text-indent: 21.25pt; text-align: justify;\">\r\n	<span lang=\"EN-US\" style=\"font-size:11.0pt;mso-bidi-font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 6pt; text-indent: 21.25pt;\">\r\n	&nbsp;&nbsp;<img alt=\"\" src=\"http://182.50.112.199:82/upload/userfiles/1/images/cms/article/2016/05/111111111111111111111111.jpg\" style=\"width: 600px; height: 327px; float: left; margin-left: 55px; margin-right: 55px;\" /></p>', '', '', '1');
